  `captcha_type` varchar(64) DEFAULT NULL COMMENT 'The challenge type to use.',
  PRIMARY KEY (`form_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='This table describes which challenges should be added to...';

