/*Table structure for table `nttrole` */

DROP TABLE IF EXISTS `nttrole`;

CREATE TABLE `nttrole` (
  `rid` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Primary Key: Unique role ID.',
  `name` varchar(64) NOT NULL DEFAULT '' COMMENT 'Unique role name.',
  `weight` int(11) NOT NULL DEFAULT '0' COMMENT 'The weight of this role in listings and the user interface.',
  PRIMARY KEY (`rid`),
  UNIQUE KEY `name` (`name`),
  KEY `name_weight` (`name`,`weight`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='Stores user roles.';

/*Data for the table `nttrole` */

insert  into `nttrole`(`rid`,`name`,`weight`) values (3,'administrator',2),(1,'anonymous user',0),(2,'authenticated user',1);

/*Table structure for table `nttrole_permission` */

DROP TABLE IF EXISTS `nttrole_permission`;

CREATE TABLE `nttrole_permission` (
  `rid` int(10) unsigned NOT NULL COMMENT 'Foreign Key: nttrole.rid.',
  `permission` varchar(128) NOT NULL DEFAULT '' COMMENT 'A single permission granted to the role identified by rid.',
  `module` varchar(255) NOT NULL DEFAULT '' COMMENT 'The module declaring the permission.',
  PRIMARY KEY (`rid`,`permission`),
  KEY `permission` (`permission`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Stores the permissions assigned to user roles.';

